const Content = ({courseParts}: {courseParts: Array<{name:string, exerciseCount: number}>}) => {
    return(
        <>
        {
            courseParts.map(c => <p key={c.name}>c.name c.exerciseCount</p>)
        }
        </>
    )
}

export default Content;
